import React, { Component } from "react";

class TopNav extends Component {
	state = {};
	render() {
		return (
			<nav>
				<div class="nav-wrapper">
					<a href="!#" class="brand-logo center">
						Wootton Chipotle
					</a>
					<ul id="nav-mobile" class="left hide-on-med-and-down"></ul>
				</div>
			</nav>
		);
	}
}

export default TopNav;
